import Phaser from '../lib/Phaser.js'

export default class Preload extends Phaser.Scene{

    platform;
    counter = 0;

    constructor()
    {
        super('preload')
    }

    preload()
    {
        this.platform = this;
        this.counter = 0;
    }

    create()
    {
        const background_imageData = "data:image/png;base64,"
        const blue_imageData = "data:image/png;base64,"
        const downloadBtn_imageData = "data:image/png;base64,"
        const endText_imageData = "data:image/png;base64,"
        const firstFrame_imageData = "data:image/png;base64,"
        const logo_imageData = "data:image/png;base64,"
        const playBtn_imageData = "data:image/png;base64,"
        const red_imageData = "data:image/png;base64,"
        const ring_imageData = "data:image/png;base64,"
        const wheel_imageData = "data:image/png;base64,"
        const wheelRef_imageData = "data:image/png;base64,"
        const wheelStp_imageData = "data:image/png;base64,"
        const ding_audioData = "data:audio/mpeg;base64,"
        const applaude_audioData = "data:audio/mpeg;base64,"
        
        
        this.platform.textures.addBase64('logo', logo_imageData)
        this.platform.textures.addBase64('wheel-reflection', wheelRef_imageData)
        this.platform.textures.addBase64('header-text', firstFrame_imageData)
        this.platform.textures.addBase64('play-button', playBtn_imageData)
        this.platform.textures.addBase64('stopper', wheelStp_imageData)
        this.platform.textures.addBase64('endText', endText_imageData)
        this.platform.textures.addBase64('download-button', downloadBtn_imageData)
        this.platform.sound.decodeAudio('applaude', applaude_audioData)
        this.platform.textures.addBase64('spark0', blue_imageData)
        this.platform.textures.addBase64('spark1', red_imageData)
        this.platform.textures.addBase64('wheelRing', ring_imageData)
        this.platform.textures.addBase64('wheelCenter', wheel_imageData)
        this.platform.sound.decodeAudio('tickSound', ding_audioData)
        this.platform.textures.addBase64('background', background_imageData)
        
        this.platform.textures.on('onload', function() {
            this.counter += 1;
        }, this);

        // Timer check when all based64 assets have been loaded
        this.platform.customTimer = this.platform.time.addEvent({ delay: 500, callback: function callback() {
            
            // Adjust counter maximum as you ecpect. For now just one based64 assets need to be loaded only
            if (this.counter === 12) {
            
                // Destroy timer to save memory
                this.platform.customTimer.remove(false);

                this.scene.start('game')
            }

        
        }, callbackScope: this.platform, loop: true}, this);   

	}

}